      const runtime = vm.runtime;

      //* from delta time extension
      let deltaTime = 0;
      let previousTime = 0;

      runtime.on("BEFORE_EXECUTE", () => {
        const now = performance.now();

        if (previousTime === 0) {
          deltaTime = 1 / runtime.frameLoop.framerate;
        } else {
          deltaTime = (now - previousTime) / 1000;
        }
        previousTime = now;
      });
